                'created_at' => '2022-05-27 10:25:24',
            'description' => 'Legendary BMW E28 M5, made in the sought-after colour combination black (086) with black interior, the start of the M5 and the first super-saloon. Only 2241 copies of the BMW E28 M5 were produced in the eighties. In short, a very rare car, there are few left.

The car is in a good technical condition for its age and it will be sold with a new Dutch periodic vehicle inspection. The engine runs well, has full power and does not have any oil leaks. Optically, the car is not bad but the paint needs attention all around to make it perfect again. The interior is in a good condition, the leather shows normal wear and tear, the dashboard is without any cracks and the headlining does not sag. The car has a few nice options such as a sunroof, electric seats, heated seats, electric windows + mirrors and cruise control. All electronics in the car work properly.

The car comes from Canada and was personally imported to the Netherlands. The car has ever had a collision to the front right, otherwise the history of the car is largely unknown. It is only known that the previous owner was an enthusiast and that he had the car in his possession for a long time. The M5 has recently had the necessary maintenance prior to the inspection. This m5 is now European with the accompanying body kit and the Euro headlights. The spare wheel, the manual, the complete tool set and the original jack are present.

The car can be viewed and picked up in Maarheeze, the Netherlands. Worldwide transport is possible

It is recommended to view the vehicle prior to placing a bid in order to avoid disappointment. Please contact Catawiki to schedule an appointment',
