The car was only in Germany until 2019 when it was brought to Norway. A folder with invoices and various other documents since 1984 has been delivered with the car. In 2021 I bought it from there and then brought it to Romania for a complete paint job (rust removed, welded, corrosion treated and painted).

The mechanics were overhauled, brakes renewed, many seals replaced. The engine and transmission were in excellent condition right from the start. The car is on original BBS 14\'\' alloy wheels - in addition you can buy a set of BBS 17\'\' wheels for an additional charge (2000 euro) (can be seen in the last photos).

The car is with me in Germany and is still registered in Romania as a classic car but the transfer for registration in Germany or elsewhere is no problem.

It is recommended to visit the car in 23619 Hamberge.',
