            34 => 
            array (
                'created_at' => '2022-06-05 18:23:10',
                'description' => '4.3l Vortec V6 engine – 280 hp – from 0 to 100 in 5.3 seconds – 200 km/h top speed

Only 4697 produced.

The GMC Typhoon is therefore the last real, powerful US muscle car to be shrunk into VW Jetta format. Its concept as a revolutionary sports SUV, its technical effort and the resulting driving pleasure are reminiscent of the craziness of the old days. The steel supported chassis, body and all-wheel drive come from the GMC S-15 Jimmy compact SUV, which was already available in 1983 and was also marketed as the Chevrolet S-10 Blazer.

Almost the entire interior and seats of the GMC Typhoon are upholstered in black leather. The rectangular instrument panel and its controls look like a hi-fi receiver.

In April 2022, the car was thoroughly inspected by US Car Special Workshop.
Engine, ignition readjusted.
All belts, steering joints new. Air conditioning modernised to R134, so no problem with refilling. It all works, only the CD player skips from time to time. But everything is original.

Original paint. After 30 years, of course, there are traces of age/small defects (stone chips, mini scratches), but these are only minimal.
2500.00 invested in service parts in 2022.
Valid TuV for Austria. No rust.
Only 45,000 miles!!!!
In this condition, comparable cars cost over €30,000 at dealerships.
Get in and drive.
Increase in value is assured.',
                'id' => 1099,
                'name' => 'GMC-Typhoon-1998',
                'price' => '20000',
                'status' => 0,
                'updated_at' => '2022-06-05 18:23:10',
