Engine, ignition readjusted.
All belts, steering joints new. Air conditioning modernised to R134, so no problem with refilling. It all works, only the CD player skips from time to time. But everything is original.

Original paint. After 30 years, of course, there are traces of age/small defects (stone chips, mini scratches), but these are only minimal.
2500.00 invested in service parts in 2022.
Valid TuV for Austria. No rust.
Only 45,000 miles!!!!
In this condition, comparable cars cost over €30,000 at dealerships.
Get in and drive.
Increase in value is assured.',
